import React, { useEffect, useState } from 'react';
import { Container, Grid, List, ListItem, ListItemIcon, ListItemText, Avatar } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import { Link } from 'react-router-dom';
import logo from './assets/secura.png';
import './App.css'; // Import the CSS file

const App = () => {
  const [userData, setUserData] = useState({ name: '', avatar: '' });

  useEffect(() => {
    fetchUserData().then(data => {
      setUserData(data);
    });
  }, []);

  const fetchUserData = async () => {
    const response = await fetch('https://jsonplaceholder.typicode.com/users/1');
    const data = await response.json();
    return data;
  };

  return (
    <div className="pageStyles"> {/* Apply the styles using classNames */}
      <Container>
        <Grid container>
          <Grid className="sidebarStyles">
            <img src={logo} alt="Logo" className="logoStyles" />
            <List>
              <ListItem button>
                <ListItemIcon sx={{ color: 'white' }}>
                  <Home />
                </ListItemIcon>
              </ListItem>
              <ListItem button>
                <ListItemIcon sx={{ color: 'white', marginLeft: '25px' }}>
                  <Inbox />
                </ListItemIcon>
              </ListItem>
              <ListItem button>
                <ListItemIcon sx={{ color: 'white', marginLeft: '25px' }}>
                  <Mail />
                </ListItemIcon>
              </ListItem>
            </List>
          </Grid>
          <Grid className="secondSidebarStyles">
            <List>
              <div style={{ color: 'white', display: 'flex', alignItems: 'center', marginLeft: "10px", marginTop: '5px' }}>
                <div>{userData.name}</div>
                <Avatar src={userData.avatar} alt="User Avatar" sx={{ marginLeft: "50px", marginTop: '5px' }} />
              </div>
              <div style={{ marginTop: "20px", textDecoration: "none" }}>
                <ListItem button sx={{ textDecoration: "none" }}>
                  <ListItemIcon sx={{ color: 'whitesmoke' }}>
                    <LiveTv />
                  </ListItemIcon>
                  <Link to="/live" sx={{ textDecoration: 'none' }}>
                    <ListItemText primary="Live" sx={{ color: 'white' }} />
                  </Link>
                </ListItem>
                <ListItem button>
                  <ListItemIcon sx={{ color: 'white' }}>
                    <ViewComfy />
                  </ListItemIcon>
                  <Link to="/layout" sx={{}}>
                    <ListItemText primary="Layout" sx={{ color: 'white', textDecoration: "none" }} />
                  </Link>
                </ListItem>
                <ListItem button>
                  <ListItemIcon sx={{ color: 'white' }}>
                    <Timeline />
                  </ListItemIcon>
                  <Link to="/sequence">
                    <ListItemText primary="Sequence" sx={{ color: 'white' }} />
                  </Link>
                </ListItem>
                <ListItem button>
                  <ListItemIcon sx={{ color: 'white' }}>
                    <MoreHoriz />
                  </ListItemIcon>
                  <Link sx={{ textDecoration: 'none', }} to="/more">
                    <ListItemText primary="More" sx={{ color: 'white', textDecoration: 'none', }} />
                  </Link>
                </ListItem>
              </div>
            </List>
          </Grid>
          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
